import { useRef } from "react";
const AddButton = () => {
    const [isActive, setIsActive] = useState(false);
    const knopka=useRef()

    const click = () => {
        knopka.current.classlist.toggle("active")       
    }
    return (
        <button ref={knopka} onClick={click()} className="add">
            Add
        </button>
    );
};
export default AddButton;
